contracts/Lock.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

contract Lock {
    struct ElectionDetails {
        string electionName;
        string[] candidateNames;
        mapping(string => uint256) candidateVotes;
    }

    struct Admin {
        string id;
        string password;
    }

    struct ElectionSummary {
        string electionName;
        string[] candidateNames;
        uint256[] votes;
    }

    mapping(string => ElectionDetails) private elections;
    mapping(string => Admin) private admins;
    string[] private electionNames; // Array to store election names

    event VoteCast(string electionName, string candidateName);

    modifier onlyAdmin(string memory _id, string memory _password) {
        require(
            keccak256(abi.encodePacked(admins[_id].password)) ==
                keccak256(abi.encodePacked(_password)),
            "Not an admin or incorrect password"
        );
        _;
    }

    constructor(
        string memory _initialAdminId,
        string memory _initialAdminPassword
    ) {
        require(bytes(_initialAdminId).length > 0, "Admin ID cannot be empty");
        require(
            bytes(_initialAdminPassword).length > 0,
            "Admin password cannot be empty"
        );
        require(
            bytes(admins[_initialAdminId].id).length == 0,
            "Admin already exists"
        );

        admins[_initialAdminId] = Admin(_initialAdminId, _initialAdminPassword);
    }

    function addAdmin(string memory _id, string memory _password) public {
        require(bytes(_id).length > 0, "Admin ID cannot be empty");
        require(bytes(_password).length > 0, "Admin password cannot be empty");
        require(bytes(admins[_id].id).length == 0, "Admin already exists");

        admins[_id] = Admin(_id, _password);
    }

    function verifyAdmin(
        string memory _id,
        string memory _password
    ) public view returns (bool) {
        return
            keccak256(abi.encodePacked(admins[_id].password)) ==
            keccak256(abi.encodePacked(_password));
    }

    function addElectionWithCandidates(
        string memory _electionName,
        string[] memory _candidates,
        string memory _adminId,
        string memory _adminPassword
    ) public onlyAdmin(_adminId, _adminPassword) returns (bool) {
        require(
            bytes(_electionName).length > 0,
            "Election name cannot be empty"
        );
        require(
            bytes(elections[_electionName].electionName).length == 0,
            "Election already exists"
        );

        elections[_electionName].electionName = _electionName;
        electionNames.push(_electionName); // Add to array

        for (uint256 i = 0; i < _candidates.length; i++) {
            elections[_electionName].candidateVotes[_candidates[i]] = 0;
            elections[_electionName].candidateNames.push(_candidates[i]);
        }

        return true;
    }

    function vote(
        string memory _electionName,
        string memory _candidateName
    ) public {
        require(
            bytes(_electionName).length > 0,
            "Election name cannot be empty"
        );
        require(
            bytes(elections[_electionName].electionName).length > 0,
            "Election does not exist"
        );

        elections[_electionName].candidateVotes[_candidateName]++;
        emit VoteCast(_electionName, _candidateName);
    }

    function getCandidateVotes(
        string memory _electionName,
        string memory _candidateName
    ) public view returns (uint256) {
        require(
            bytes(_electionName).length > 0,
            "Election name cannot be empty"
        );
        require(
            bytes(elections[_electionName].electionName).length > 0,
            "Election does not exist"
        );

        return elections[_electionName].candidateVotes[_candidateName];
    }

    function getCandidateNames(
        string memory _electionName
    ) public view returns (string[] memory) {
        require(
            bytes(_electionName).length > 0,
            "Election name cannot be empty"
        );
        require(
            bytes(elections[_electionName].electionName).length > 0,
            "Election does not exist"
        );

        return elections[_electionName].candidateNames;
    }

    function getElectionResult(
        string memory _electionName
    ) public view returns (string memory, string[] memory, uint256[] memory) {
        require(
            bytes(_electionName).length > 0,
            "Election name cannot be empty"
        );
        require(
            bytes(elections[_electionName].electionName).length > 0,
            "Election does not exist"
        );

        ElectionDetails storage election = elections[_electionName];
        uint256 length = election.candidateNames.length;
        uint256[] memory votes = new uint256[](length);

        for (uint256 i = 0; i < length; i++) {
            votes[i] = election.candidateVotes[election.candidateNames[i]];
        }

        return (election.electionName, election.candidateNames, votes);
    }

    function getAllElections() public view returns (ElectionSummary[] memory) {
        uint256 count = electionNames.length;
        ElectionSummary[] memory allElections = new ElectionSummary[](count);

        for (uint256 i = 0; i < count; i++) {
            string memory electionName = electionNames[i];
            ElectionDetails storage election = elections[electionName];
            uint256 length = election.candidateNames.length;
            uint256[] memory votes = new uint256[](length);

            for (uint256 j = 0; j < length; j++) {
                votes[j] = election.candidateVotes[election.candidateNames[j]];
            }

            allElections[i] = ElectionSummary({
                electionName: election.electionName,
                candidateNames: election.candidateNames,
                votes: votes
            });
        }

        return allElections;
    }
}

